import React, { useState, useEffect } from "react";
import Navbar from "./Navbar";
import { useNavigate, useParams } from "react-router-dom";
import Pro from "./user.png";

const Developers = () => {
  const [items, setItems] = useState([]);
  const { id } = useParams();
  const navigate = useNavigate();

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch("http://localhost:5000/developers/" + id, {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
        });
        const data = await response.json();
        if (data.result.length === 0) {
          alert(data.message);
          navigate("/home");
        } else {
          setItems(data.result);
        }
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, [id]);

  return (
    <div>
      <Navbar />
      <div className="container bg-dark-subtle mt-5 py-5 border border-warning">
        <div className="text-center">
          <h1>Web Developers</h1>
        </div>
        <div className="row justify-content-center">
          {items.map((item, index) => (
            <div key={index} className="col-md-6 mb-4">
              <div className="row border border-warning rounded p-3">
                <div className="col-md-4">
                  <img
                    src={Pro}
                    alt="User"
                    className="img-fluid"
                    style={{ maxHeight: "200px" }}
                  />
                </div>
                <div className="col-md-8">
                  <h5>{item.name}</h5>
                  <p>
                    Rating:{" "}
                    {[...Array(item.rating)].map((_, index) => (
                      <span key={index} className="text-warning">
                        â˜…
                      </span>
                    ))}
                  </p>
                  <p>Username: {item.username}</p>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Developers;
